#!/bin/bash

# line number where payload starts
PAYLOAD_LINE=$(awk '/^__PAYLOAD_BEGINS__/ { print NR + 1; exit 0; }' $0)
VERSION="3.0.0"

usage() {
cat <<EOF
Usage: $(basename "${0}") [-v] [-h]

extracts all UIM client relevant files and installs cronjob 

Available options:

-h  Print this help and exit
-v  Print UIM client version
EOF
exit
}


install() {
    if [ "$UID" -ne 0 ]
        then echo "Please run as root"
        exit -1
    fi

    tail -n +${PAYLOAD_LINE} $0 | base64 -d | tar -zpx -C /
    chmod 700 /var/ldap/scripts/setup_app_cron.sh
    bash /var/ldap/scripts/setup_app_cron.sh
}

SHOW_VERSION=false
while getopts :vh flag;do
    case "${flag}" in
        h) usage ;;
        v) SHOW_VERSION=true ;;
    esac
done

if [ "$#" -eq 0 ]; then
    install
    exit 0
fi

if [ "$#" -eq 1 ]; then
    if ${SHOW_VERSION}; then
        echo "$VERSION";
        exit 0
    fi
fi
usage



exit 0
